import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Importa los componentes de enrutamiento

function App() {
  return (
    <div>
      <h1>¡Hola Mundo!</h1>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </div>
  );
}

function Home() {
  return <h2>Página de Inicio</h2>;
}

function About() {
  return <h2>Acerca de Nosotros</h2>;
}

export default App;
